/* Search List of Businesses */

function checkItem(entry) {
    var toLower = document.getElementById("inputToCheck").value.toLowerCase();
    lowerEntry = entry.toLowerCase()
    return (lowerEntry.includes(toLower));
}

function searchBusinessList() {
    var FunctionOutput = businesses.find(checkItem);
    if (FunctionOutput == null) {
        document.getElementById("output").innerHTML = "business not found";
    }
    else {
        document.getElementById("output").innerHTML = FunctionOutput;
    }
}

/* Add the Selected Option to Favorites List */

function addToFavoritesList() {
    var SelectedItem = document.getElementById("output").innerHTML;
    var ul = document.getElementById("myUl");
    var li = document.createElement("li");
    li.appendChild(document.createTextNode(SelectedItem));
    ul.appendChild(li);
}

